import React from "react";
import { Box, Heading } from "@chakra-ui/react";
export const Chat = () => {
  return (
    <div>
      <Box
        minH="100vh"
        py="12"
        px={{
          base: "4",
          lg: "8",
        }}
        bgGradient="linear(to-l, #7928CA, #FF0080)"
      >
        <Heading>AI Chat Therapy</Heading>
      </Box>
    </div>
  );
};
